import { FETCH_FOODS } from "../constants/actionTypes"



export const foodsReducer = (state = ({products:[]}), {type,payload}) => {
  switch (type) {
    case FETCH_FOODS:      
      return { ...state,products: payload }
      
    default:
      return state
  }
};
